import './Navigation.css'

export default function Navigation() {
	return (
			<div>
				<div className='nav'>
					<ul>
						<li className='item'>Home</li>
						<li className='item'>Menu</li>
						<li className='item'>User</li>
					</ul>
				</div>
			</div>
	  );
}
